import React from "react";

export const LoginForm = ({
    username,
    setUsername,
    password,
    setPassword
}) => {
    return (
        <form /*onSubmit={handleSubmit}*/>
            <label>
                Username:
                <input type='text' /*value={username} onChange={(e) => setUsername(e.target.value)}*//>
            </label>
    
            <label>
                Password:
                <input type='text'/>
            </label>

            
            
            <h2>LOGIN</h2>
            <p>Forgot Username?</p>
            <p>Forgot Password?</p>
            <p>Create account</p>
        </form>
  );
}
